Information
------------------------------

Young Welsh and Pretty Skint 
Young people in the south Wales valleys spend more on looking good than in the most prosperous parts of London. Tattoos, tans, botox and boobs - a journey into the world of looking good and feeling poor as young Welsh men and women reveal all in their pursuit of the body beautiful.
Mark spends so much on his multiple weekly trips to the tanning salon, gym and eyebrow stylist that he's had to move back into his parents' house - despite having a full-time job. &quot;It is a bit stupid when you think about it,&quot; he admits.
And in a part of the country where jobs and wages are low, even the beauticians are getting concerned. Stylist Jade, who recounts tales of 14-year-old girls desperate for full treatments, notes that &quot;it's better than the kids going out and doing drugs - but at the same time, kids aren't kids these days, are they?&quot;

